    false,nt"url": null,nt"notes": "NODC Accession 0083633 includes chemical,
    discrete bottle, physical, profile, underway - surface data collected aboard NOAA
    Ship RONALD H. BROWN in East Coast - US/Canada, Gray's Reef National Marine Sanctuary,
    Gulf of Mexico, North Atlantic Ocean, and Stellwagen Bank National Marine Sanctuary
    from 20070511 to 20070804 and retrieved during cruise 33RO20070511. These data include
    ALKALINITY, AMMONIA, CARBON DIOXIDE - MOLE FRACTION - AIR, CARBON DIOXIDE - PARTIAL
    PRESSURE - SEA, DISSOLVED INORGANIC CARBON, DISSOLVED ORGANIC CARBON, DISSOLVED
    OXYGEN, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE, and TEMPERATURE - WATER.
    The instruments used to collect these data include CTD, Carbon dioxide (CO2) gas
    analyzer, Carbon dioxide (CO2) shower head chamber equilibrator, and thermosalinographs.
    These data were collected by Rik Wanninkhof and Jia-Zhong Zhang of Atlantic oceanographic
    and meteorological laboratory, Wei-Jun Cai of University of Georgia, Joe Salisbury
    of University of New Hampshire, and Robert Byrne of University of South Florida.",nt"owner_org":
